import { useState } from "react";
import HostSearchList from "./HostList";
import HostSearchOption from "./HostSearchOption";

const HOSTS = [
    { id: "e1", title: "event 1" },
    { id: "e2", title: "event 2" },
    { id: "e3", title: "event 3" },
  ];


 const HostSearch = () => {
    const [hostList, setHostList] = useState([]);

    return (
        <>
            <HostSearchOption setHostList={setHostList} />
            <HostSearchList hosts={hostList} />
        </>
    )
 } 

 export default HostSearch;
